#include <bits/stdc++.h>

using namespace std;

int main() {

    int N, K, S, T, x, y, z;
    cin >> N >> K;
    N++;
    vector<vector<pair<long long,long long>>> g(N);
    for (int i = 0; i < K; ++i) {
        cin >> x >> y >> z;
        g[x].push_back({ z, y });
        g[y].push_back({ z, x });
    }
    cin >> S >> T;
    //cout << S << " " << T;

    long long inf = 1e18;
    priority_queue<pair<long long, long long>> q;
    vector<long long> d(N, inf);
    vector<int> prev(N, -1);
    d[S] = 0;
    q.push({ d[S], S });
    int cnt = 0;
    while(!q.empty()){
        long long v = q.top().second;
        long long cur_d = -q.top().first;
        q.pop();
        cnt++;
        if(cur_d > d[v])continue;
        for(auto x: g[v]){
            long long to = x.second;
            long long len = x.first;
            if(d[v] + len < d[to]){
                d[to] = d[v] + len;
                prev[to] = v;
                q.push(make_pair(-d[to], to));
            }
        }
    }
    //cout << cnt << "\n";
    if(d[T] < inf){
        cout << d[T] << "\n";
        return 0;
        stack<int> path;
        while(T != -1){
            path.push(T + 1);
            T = prev[T];
        }
        while(!path.empty()){
            cout << path.top() << " "; path.pop();
        }
    }
    else{
        cout << -1;
    }

    return 0;
}

