#include <iostream>
#include <vector>
#include <utility>
#include <queue>
#include <stack>

using namespace std;

const double double_inf=1e18;


int main(int argc, char *argv[])
{
	int n;
	cin>>n;
	
	vector<int> t(n+1);
	vector<int> v(n+1);
	
	for(int i=1; i<=n; ++i)
	    cin>>t[i]>>v[i];
	    
	vector<vector<pair<int,int>>> g(n+1);
	
	for(int i=0; i<n-1; ++i){
	      int a,b, s;
	      cin>>a>>b>>s;
	      g[a].push_back({b,s});
	      g[b].push_back({a,s});
	}
	
	vector<vector<double>> dist(n+1);
	
	for(auto &vec: dist)
	    vec.assign(n+1, double_inf);
	    
	for(int i=1; i<=n; ++i){
	    
	    stack<int> s;
	    s.push(i);
	    
	    int velocity = v[i];
	    int preparation_time = t[i];
	    
	    dist[i][i] = 0;
	    
	    vector<bool> visited_dfs(n+1, false);
	    
	    vector<int> path_dfs(n+1);
	    path_dfs[i] = 0;
	    
	    while(!s.empty()){
	        int vertex = s.top();
	        s.pop();
	        
	        visited_dfs[vertex]=true;
	        
	        for(int j=0; j<g[vertex].size();++j){
	           int to = g[vertex][j].first;
	           
	           if(visited_dfs[to])
	               continue;
	           
	           int len = g[vertex][j].second;
	           
	           path_dfs[to] = path_dfs[vertex]+len;
	           
	           dist[i][to] =(double) path_dfs[to] / velocity + preparation_time;
	           
	           s.push(to);
	        }
	    }
	}
	
//	for(int i=1; i<=n;++i)
	 //   for(int j=1; j<=n; ++j)
//	        cout<<i<<' '<<j<<' '<<dist[i][j]<<endl;
	
	vector<double> dist2(n+1, double_inf);
	vector<int> prev(n+1);
	vector<bool> visited(n+1, false);
	prev[1] = -1;
	
	dist2[1]=0;
	
	for(int i=1; i<=n; ++i){
	     int vertex=-1;
	     for(int j=1; j<=n; ++j)
	         if(!visited[j] &&(vertex==-1 || dist2[j] < dist2[vertex])) 
	         vertex = j;
	         
	     if(vertex==-1 || dist2[vertex]==double_inf)
	         break;
	         
	     visited[vertex] = true;
	     
	     for(int j=1; j<=n; ++j){
	         if(vertex == j)
	             continue;
	             
	         int to = j;
	         double len = dist[to][vertex];
	         
	         if(dist2[vertex]+len <dist2[to]){
	              dist2[to] = dist2[vertex]  + len;
	              prev[to] = vertex;
	         }
	     }
	}
	
	int max_index = -1;
	double max_time =0;
	
	for(int i=1; i<=n; ++i){
	     if(dist2[i] > max_time)   {
	         max_time=dist2[i];
	         max_index = i;
	     }
	}
	
	
	double res = max_time;
	int city = max_index;
	
	cout<<res<<endl;
	
	while(city!=-1){
	     cout<<city<<' ';
	     city=prev[city];
	}
	
	cout<<endl;
	
	return 0;
}

