void f(int broj, char c) {
    for(int i = broj; i > 0; i--) {
        for(int j = 0; j < i; j++) {
            printf("%c ", c);
            
        }
        c -= 1;
    }
}

int main(int argc, char * argv[]) {
    int broj;
    char c;
    scanf("%d", &broj);
    scanf(" %c", &c);
    
    printf("%d %c\n", broj, c);
    f(broj, c);
    
    return 0;
}

