#include <string.h>
#include <ctype.h>
#include <math.h>

int main(int argc, char * argv[]) {
    int a, b;
    scanf("%d%d", &a, &b);
    
    for(int i = a; i <= b; i++) {
        int tmp = i;
        int prevrten = 0;
        
        while(tmp > 0) {
            int cifra = tmp % 10;
            prevrten = (prevrten * 10) + cifra;
            tmp /= 10;
        }
        int deliteli = 0;
        for(int j = 1; j <= prevrten; j++) {
            if(prevrten % j == 0) {
                deliteli++;
            }
        }
        if(deliteli <= 2) {
            printf("%d ", i);
        }
    }
    
    return 0;
}

